import React, { Component } from "react";

export default class HeaderItemNotify extends Component {
  render() {
    let { course } = this.props;
    return (
      <div className="row header-item">
        <div className="col-4 p-0 header-img">
          <img className="img-fluid" src="https://dvch1hlupt.cdn.hostvn.net/notification/image/khuy_n_m_i_2.png" alt="" />
        </div>
        <div className="col-8 header-content ">
          {/* <p>{course.tenKhoaHoc}</p>
                    <p style={{ color: "red" }}>$19.99</p> */}
        </div>
      </div>
    );
  }
}
